import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import axios from "axios";

// const search = "홍대맛집";
const BASE_URL = "http://whrbdnjs33.asuscomm.com:5432/matzip/?search=홍대맛집";

function ListThree() {

    const [data, setData] = useState([]);

    const api = axios.create({
        baseURL: BASE_URL
    })

    const getFood = api.get(BASE_URL, );
        //"matzip/", { params: { search } });

    useEffect(() => {
        getFood.then((res) => {
            setData(res.data);
        })
    }, []);

    return (
        <>
            {data.map((post) => post.allowed == true ?
                <Image>
                    <img src={post.url} style="width:300px; height:300px; object-fit: cover;"/>
                </Image>
                : null
            )}
        </>
    )
}

const Image = styled.div`
    width: 300px;
    height: 300px;
    padding: 3px;
`;

export default ListThree;
